import SubMenu from './SubMenu'

function NavMenu(props) {
  return (
    <li className="navitem"><a className="navitem__link" href="#">{props.navItem}  {props.childitem !== "" ? <SubMenu childitem={props.childitem} /> : "" }</a></li>
  )
}

export default NavMenu
